import styled from 'styled-components';

const CreateBtn = styled.button`
  position: absolute;
  right: 30px;
  bottom: 40px;

  width: 80px;
  height: 80px;
  border-radius: 50%;
  border: none;
  background-color: #909DD9;
  text-align: center;
  /* margin: 0 auto; */

  .add {
    color: #fff;
    font-size: 50px;
    font-weight: 500;
  }

  &:hover {
    background-color: #b8c1eb;
  }
`

export function InputBtn(){
  return (
    <>
      <CreateBtn>
        <span className='add'>+</span>
      </CreateBtn>
    </>
  )
}
